import React, { Component } from "react";
import axios from "axios";

class Benefits extends Component {
  constructor(props) {
    super(props);
    this.state = {
      facilities: [],
      mainData: {},
    };
  }

  componentDidMount() {
    this.fetchFacalitiesData();
    this.fetchMainData();
  }

  fetchFacalitiesData = async () => {
    try {
      const response = await axios.get(
        "http://195.210.47.82:8000/facility/main/facalities/"
      );
      this.setState({ facilities: response.data });
    } catch (error) {
      console.error("Ошибка при получении данных фасилити:", error);
    }
  };

  fetchMainData = async () => {
    try {
      const response = await axios.get(
        "http://195.210.47.82:8000/facility/main/"
      );
      this.setState({ mainData: response.data });
    } catch (error) {
      console.error("Ошибка при получении основных данных:", error);
    }
  };

  render() {
    const { facilities, mainData } = this.state;

    return (
      <div className="benefits" id="benefits">
        <h1 className="benefits__title">Company Benefits</h1>
        <div className="benefits__main-data">
          <h2>Main Data:</h2>
          <p>Some main data here: {mainData.someField}</p>
          {/* Вывод других данных из mainData */}
        </div>
        <div className="benefits__container">
          {facilities.map((facility, index) => (
            <div key={index} className="benefits__item">
              <h1 className="benefits__item__title">{facility.name}</h1>
              <h4 className="benefits__item__subtitle">
                Programs count: {facility.count}
              </h4>
              {/* Здесь можно добавить другие поля из данных объекта facility */}
            </div>
          ))}
        </div>
      </div>
    );
  }
}

export default Benefits;
